import React from 'react';

export default function Weather() {


    fetch('https://api.openweathermap.org/data/2.5/onecall?lat=33.44&lon=-94.04&exclude=hourly,daily&appid=57a0a94dc910ede17013fdbebbdb242c')  
        .then(function(resp) { return resp.json() }) // Convert data to json
        .then(function(data) {
        console.log(data);
        let weatherData = data;
  })
    .catch(function() {
    // catch any errors
  });

    return(
        <div>
            <h2>Looks like good weather for Connect-4 in Chapel Hill!</h2>
            <subtitle>Temp: {weatherData.temp}</subtitle>
            <subtitle>Humidity: {weatherData.humidity}</subtitle>
            <subtitle>Conditions: {weatherData.weather.main}</subtitle>
        </div>
  );
}
